import React, {createContext} from 'react';
import ReactDOM from 'react-dom';
import './index.css';

export const TreesContext = createContext();

const trees = [
  {id: "1", type: "Maple"},
  {id: "2", type: "Oak"},
  {id: "3", type: "Family"},
  {id: "4", type: "Component"}
]

function App(){

  return(
    <div>

    </div>
  )
}
ReactDOM.render(
  <TreesContext.Provider value={{trees}}>
    <App />
  </TreesContext.Provider>,
  document.getElementById('root')
);
